import React from "react";

function GameTitleWithIcon() {
  return (
    <header className="flex gap-5 justify-between text-7xl text-white max-md:flex-wrap max-md:text-4xl">
      <h1 className="flex-auto max-md:max-w-full max-md:text-4xl">{props.title}</h1>
      <img
        loading="lazy"
        src={props.iconSrc}
        alt={props.iconAlt}
        className="my-auto w-20 aspect-[1.01]"
      />
    </header>
  );
}

export default function NavBar() {
  return (
    <GameTitleWithIcon
      title="Mexican Train Dominoes"
      iconsrc="https://cdn.builder.io/api/v1/image/assets/TEMP/454567658b547d84431fbbdf8224a75d18594956415276dd425887318929e8c0?apiKey=7293d20271ec4f72a58fe358903b4fd6&"iconAlt="Game Icon"
    />
  );
}
